#if WINDOWS_UWP
			internal
#else
			public
#endif
			static SpecificEnergyUnit ParseUnit(string str, IFormatProvider formatProvider = null)
			{
				if (str == null) throw new ArgumentNullException("str");

				var unitSystem = UnitSystem.GetCached(formatProvider);
